      name: "Average Price",
      selector: (row) =>
        new Intl.NumberFormat("en-US", {
          style: "currency",
          currency: "USD",
        }).format(row.average),
    },
    {
      name: "Max Price",
      selector: (row) =>
        new Intl.NumberFormat("en-US", {
          style: "currency",
          currency: "USD",
        }).format(row.max),
    },

    {
      name: "Actions",
      selector: (row) => (
        <ResearchReport
          setboton={setboton}
          setpdf={setpdf}
          sku={row.sku}
          report={row.report}
          min={row.min}
          average={row.average}
          max={row.max}
	   /> 
      ),
    }, */
  ];

  return (
    <>
      {pdf.loading ? (
        <DataTable
          striped
          columns={columnas}
          data={data}
          pagination
        />
      ) : (
        <Center>
          {/*<PdfViewer pdf={pdf} /> */}
        </Center>
      )}
    </>
  );
}
